import { React, useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import Card from "./components/Cards.jsx"

const App=()=> {
  const card1={
    value:"3",
    type:"D"
  }
  const card2={
    value:"11",
    type:"D"
  }
  const cardList=[]

  cardList.push(card1)
  cardList.push(card2)

  return (
    <div className="App">
      {cardList.map(card=><Card 
      value={card.value}
      type={card.type}
     />)}

    </div>
  );
}

export default App;
